import React from 'react';

const AdminDashboard = () => {
    return(
        <div>
        <h1>Admin Dashboard</h1>

        <a href='/admindashboard/manage-users'>Manage Users</a>
        <br></br>
        <a href='/admindashboard/manage-inventory'>Manage Invetory</a>
        </div>
    );
};

export default AdminDashboard;
